import React from 'react';

import './project-images.css';
import ideasworxMockup from '../../images/ideasworx/mockup-ideasworx-mobile.jpg'

export default function ProjectImages({data}) {

    return (
        <div className='project-images'>
            <div className='devices-option'>
                <div className='device-icon-container'>
                    <a href='#'><div className='mobile-icon device' /></a>
                </div>
                <div className='device-icon-container'>
                    <a href='#'><div className='desktop-icon device' /></a>
                </div>
            </div>

            <div className='full-screen' />
            <div className='images-container mobile'>
                {data.interface.mobile.map(img => (
                    <img src={img} alt='image one'/>
                ))}
            </div>
        </div>
    )
}
